大人気イラストレーター・漫画家のカナヘイさんが描く、愛らしい小動物たちのグッズが新登場。
カナヘイの小動物のランチトートが登場！！
ピスケとうさぎと一緒にランチは楽しそうだね♪

■メーカー：ドリームラッシュ
■素材：コットン（※この製品は、素材の特性上収縮しますので、洗濯する事はできません。）
